import React from "react";


class SuccessMessage extends React.Component{
    render(){
        if(this.state.phase === 0){
            console.log(this.props);
            return(
                <div className="message-wrapper"　onClick={this.countClick}>
                    <p>
                    内定獲得！！
                    </p>
            </div>
            );
        }
        else{
            return(
                <div className="message-wrapper" onClick={this.countClick}>
                    <p>
                        (これでゲームは終了です)
                    </p>
            </div>
            );
        }
    }
}

export default SuccessMessage;
